with open('cifre.in') as fin, open('cifre.out', 'w') as fout:
    a, b = map(int, fin.readline().split())
    cifre = set()
    cifre_comune = set()
    for i in str(a):
        cifre.add(i)
    for i in str(b):
        if i in cifre:
            cifre_comune.add(i)
    if cifre_comune:
        fout.write(' '.join(sorted(cifre_comune)) + '\n')
    else:
        fout.write('-1\n')
    ans = ''
    for i in sorted(set(str(a) + str(b)), reverse = True):
        ans += i * (str(a) + str(b)).count(i)
    fout.write(ans + '\n')
